    exp = 11
    results = []
    for ai in a:
        p10 = 1
        e10 = 0
        while p10 <= ai:
            p10 = p10 * 10
            e10 = e10 + 1
        b = 5 ** exp * ai % 2 ** e10
        b = (2 ** e10 - b) % 2 ** e10
        if b % 5 == 0:
            b = b + 2 ** e10
        ai = ai * 10 ** exp + b * 2 ** exp
        e10 = e10 + exp
        ans = -1
        cur = 2 ** (e10 + 5)
        for dig in range(1, e10 + 1):
            step = 4 * 5 ** (dig - 2)
            if dig == 1:
                step = 1
            b = ai % 10 ** dig
            for i in range(5):
                x = pow(2, cur, 10 ** dig)
                if b == x:
                    break
                cur = cur + step
            else:
                break
        else:
            ans = cur
        results.append(ans)
    return results

